func (s *ActivitySmartContract) queryAllActivities(APIstub shim.ChaincodeStubInterface) sc.Response {

	fields := []string{"_id",
		"actorApprovedId",
		"actorId",
		"amount",
		"date",
		"createAt",
		"description",
		"lastCreateAt",
		"percentage",
		"type",
		"purpose"}

	query := map[string]interface{}{
		"selector": map[string]interface{}{
			"_id": map[string]interface{}{
				"$regex": "^activity:",
			},
		},
		"fields": fields,
	}

	queryBytes, err := json.Marshal(query)
	if err != nil {
		return shim.Error("error marshal")
	}

	//APIstub.GetQueryResult()
	resultsIterator, err := APIstub.GetQueryResult(string(queryBytes))

	if err != nil {
		return shim.Error(err.Error())
	}
	defer resultsIterator.Close()

	// buffer is a JSON array containing QueryResults
	var buffer bytes.Buffer
	buffer.WriteString("[")

	bArrayMemberAlreadyWritten := false
	for resultsIterator.HasNext() {
		queryResponse, err := resultsIterator.Next()
		if err != nil {
			return shim.Error(err.Error())
		}
		// Add a comma before array members, suppress it for the first array member
		if bArrayMemberAlreadyWritten == true {
			buffer.WriteString(",")
		}
		buffer.WriteString("{\"Key\":")
		buffer.WriteString("\"")
		buffer.WriteString(queryResponse.Key)
		buffer.WriteString("\"")

		buffer.WriteString(", \"Record\":")
		// Record is a JSON object, so we write as-is
		buffer.WriteString(string(queryResponse.Value))
		buffer.WriteString("}")
		bArrayMemberAlreadyWritten = true
	}
	buffer.WriteString("]")

	fmt.Printf("- queryAllActivities:\n%s\n", buffer.String())

	return shim.Success(buffer.Bytes())

}

