func (s *ActivitySmartContract) updateActivity(APIstub shim.ChaincodeStubInterface, args []string) sc.Response {

	if len(args) != 12 {
		return shim.Error("Incorrect number of arguments. Expecting 12")
	}

	activityAsBytes, _ := APIstub.GetState(args[0])

	if activityAsBytes == nil {
		return shim.Error("This activity does not exist in the state database")
	}

	activity := Activity{}
	json.Unmarshal(activityAsBytes, &activity)

	activity.Date = args[1]
	activity.Type = args[2]
	activity.Amount = args[3]
	activity.Purpose = args[4]
	activity.Percentage = args[5]
	activity.CreateAt = args[6]
	activity.Description = args[7]
	activity.ActorId = args[8]
	activity.ProofImage = args[9]
	activity.LastCreateAt = args[10]
	activity.ActorApprovedId = args[11]

	activityAsBytes, _ = json.Marshal(activity)
	APIstub.PutState(args[0], activityAsBytes)

	return shim.Success(nil)

}

